/* 1050. String Subtraction (20) *//* time to AC: 2016-6-25 *//* Accepted! 20/20 *//* what's the difference between map and set? *//* and why it's so efficient to use std::set to find?  */#include<iostream>#include<cstdio>#include<set>#define MAX_SIZE 10000using namespace std;int main(){   	char str1[MAX_SIZE];   	char str2[MAX_SIZE];	set<char> my_set;	gets(str1);	gets(str2);	for(int i=0;str2[i]!='\0';i++){		my_set.insert(str2[i]);	}	set<char>::iterator iter;	for(int i=0;str1[i]!='\0';i++){		iter=my_set.find(str1[i]);		if(iter == my_set.end()){			printf("%c",str1[i]);		}	}	return 0;}